programme.desc:
Captains George and Lain head down the road to Key West and meet up with good buddy, Captain Scott Stoky. The Guyz hop aboard Scott's 39 foot Contender and set their sights on the patch reefs. Yellowtail and Gray Snappers fill the fish box while waiting for the Ballyhoo to show up. After catching bait, the Guyz head to deeper water and hook up on big Rainbow Runners, Blackfin Tuna, and Sharpnose Sharks before wrapping up their day trolling for Barracuda. George and Lain visit the Key West Shipwreck Museum where George can't keep his hands to himself, then stop for dinner at the Thirsty Mermaid where they enjoy seared scallops while sipping on Jefferson's Ocean.

Watch more of The Fish Guyz here: https://www.carbontv.com/shows/the-fish-guyz/

